const TextInput = ({label, name, value, valueChanged, onChange, form, resorts}) => {
    return (
        <label>{label} 
            <input 
            key="text-input"
            type="text" 
            name={name}
            value={value}
            onChange={onChange}
            id={ resorts.has(form[value].toLowerCase()) === true ? "error" : form[valueChanged] ? form[value].length > 0 ? "no-error" : "error" : null }
            />
        </label>
    )
}

export default TextInput;
